Feedback.create({"id"=>"1", "ad_id"=>"1", "from_user_id"=>"3", "score"=>"5", "body"=>"En god allround pulk som både jeg og min kone lett kan dra til tross for mye bagasje! Pris,\r\nkvalitet og utleier er det ingenting å utsette på. Anbefales. "})
Feedback.create({"id"=>"2", "ad_id"=>"1", "from_user_id"=>"4", "score"=>"5", "body"=>"Jan Erik møtte opp til avtalt tid og produktet stemte godt overens med annonsen. En fantastisk\r\ngod pulk som både minstemann og forelde var veldig fornøyd med og som vi veldig gjerne leier\r\nigjen. Anbefales til alle som ikke har plass hjemme og som samtidig ønsker en pulk av god\r\nkvalitet til en lav pris! "})
Feedback.create({"id"=>"3", "ad_id"=>"1", "from_user_id"=>"5", "score"=>"4", "body"=>"Leter du etter en god, lett pulk av god kvalitet, er dette den må du leie. Produktet er helt i tråd\r\nmed annonse-beskrivelsen og til tross for en liten misforståelse fra min side, har jeg ingen\r\nproblem med å anbefale både Jan Erik og pulken til andre. Tommel opp! "})
Feedback.create({"id"=>"4", "ad_id"=>"2", "from_user_id"=>"3", "score"=>"5", "body"=>"En veldig god skiboks som passet perfekt på bilen vår. Trygve hadde universalfester som vi også\r\nfikk låne uten ekstra kostnad. Fantastisk service og et veldig godt produkt. Anbefales. "})
Feedback.create({"id"=>"5", "ad_id"=>"2", "from_user_id"=>"4", "score"=>"5", "body"=>"Vi hadde dessverre ikke mulighet til å hente boksen, men det var ingen problem for utleier. Han\r\ntok den med seg til oss og hjelp til med monteringen. Vi kommer garantert til å leie fra Trygve\r\nigjen! "})
Feedback.create({"id"=>"6", "ad_id"=>"2", "from_user_id"=>"1", "score"=>"5", "body"=>"Anbefales da jeg ikke har noe å utsette verken på annonsen eller utleier. "})
Feedback.create({"id"=>"7", "ad_id"=>"3", "from_user_id"=>"6", "score"=>"5", "body"=>"Her var det lite å klage på. Skiboksen satt som smurt på taket og Eivind var behjelpelig med å montere den. Terningkast 5 på både produkt og servicen til Eivind."})
Feedback.create({"id"=>"8", "ad_id"=>"3", "from_user_id"=>"7", "score"=>"4", "body"=>"Synes det var litt knotete å montere denne boksen. Det ble oppgitt i annonsen at dette skulle være lett som bare det. Men etter ca 30 mi var den på plass og vi kunne sette avgårde mot fjellet. Eivind var uansett super som utleier og hjalp oss både med montering og avmontering."})
Feedback.create({"id"=>"9", "ad_id"=>"3", "from_user_id"=>"8", "score"=>"5", "body"=>"Både Skiboks og «handelen» med Eivind gikk helt etter planen. Supert opplegg på alle måter!"})
Feedback.create({"id"=>"10", "ad_id"=>"4", "from_user_id"=>"9", "score"=>"5", "body"=>"Hva skal man si annet en at måten Plendit har gjort det enkelt og trygt å leie ting på er fantastisk bra?! Skiboksen var akuratt som det stod i annonsen, Anne var på plass ute i garasjen da vi kom og betalingen gikk raskt og smidig via appen til Plendit. Blir ikke siste gang jeg bruker denne tjenesten."})
Feedback.create({"id"=>"11", "ad_id"=>"4", "from_user_id"=>"10", "score"=>"5", "body"=>"Både skiboksen og utleier (Anne) fortjener 5 stjerner…super service og kvalitet tvers gjennom på skiboksen."})
Feedback.create({"id"=>"12", "ad_id"=>"4", "from_user_id"=>"11", "score"=>"5", "body"=>"Ingen ting å utsette. Leier gjerne både skiboks og andre ting av Anne dersom det skulle bli aktuelt senere."})
Feedback.create({"id"=>"13", "ad_id"=>"5", "from_user_id"=>"12", "score"=>"5", "body"=>"Skiboksen var akuratt det vi så etter. Produktet var i sa mme stand som det ble omtalt i på Plendit. Ingen problem med å anbefale Ivar og leie av denne skiboksen til andre."})
Feedback.create({"id"=>"14", "ad_id"=>"5", "from_user_id"=>"13", "score"=>"4", "body"=>"Boksen var perfekt til den helgen vi skulle til Hemsedal. Veldig lett både å montere og ta av da vi var ferdig med å leie den den av Ivar. Hadde det ikke vært for at Ivar 15 min for sen til avtalt tidspunkt for overlevering så hadde vi gitt han 5 stjerner på ratingen."})
Feedback.create({"id"=>"15", "ad_id"=>"5", "from_user_id"=>"14", "score"=>"5", "body"=>"Tipp topp...både skiboksen og Ivars service. Anbefales!"})


